import './Header.css'

function Header() {
    return (
      <header>
        header입니다.
        <div class="menu">
            <span>로그인</span>
            <span>회원가입</span>
        </div>
        <a href="/" class="logo">Community</a>
      </header>
    );
  }
  
  export default Header;
